B.hP=new A.b7(24,{profileName:"\ubc15\uc11d\uc900",profileNameAlter:"Sukjun (Johnny) Park",profilePosition:"\uac8c\uc784 \uac1c\ubc1c\uc790",profileEmail:"pos02232@gmail.com",introductionTitle:"\ud83d\udc4b \uc548\ub155\ud558\uc138\uc694! KOG\uc758 \uac8c\uc784 \uac1c\ubc1c\uc790 \ubc15\uc11d\uc900\uc785\ub2c8\ub2e4.",introductionLine1:"\ubb34\ub8cc\ud55c \uc77c\uc0c1\uc744 \uac8c\uc784 \uac1c\ubc1c\uc73c\ub85c \ub54c\uc6b0\uae30\ub97c \uc88b\uc544\ud569\ub2c8\ub2e4.",introductionLine2:"\ubaa8\ub450\uac00 \ud55c\ubc88 \ucbe4\uc740 \ub4e4\uc5b4\ubcf8 \uac8c\uc784\uc744 \uac1c\ubc1c\ud558\ub294 \uac83\uc774 \uc81c \uc0b6\uc758 \ubaa9\ud45c\uc785\ub2c8\ub2e4.",interestTitle:"\u2728 \uad00\uc2ec\uc0ac",interest1:"\uac8c\uc784 \uac1c\ubc1c",interest2:"\uadf8\ub798\ud53d \ud504\ub85c\uadf8\ub798\ubc0d",skillLanguageTitle:"\uc5b8\uc5b4",skillEngineTitle:"\uac8c\uc784 \uc5d4\uc9c4 / \ud504\ub808\uc784\uc6cc\ud06c",skillDevelopmentToolTitle:"\uac1c\ubc1c \ub3c4\uad6c",skillGraphicsAPITitle:"\uadf8\ub798\ud53d API",educationTitle:"\ud83c\udf93 \ud559\ub825",educationSchool1:"DigiPen Institute of Technology",educationDegree1:u.a,educationSchool2:"\uacbd\ubd81\ub300\ud559\uad50",educationDegree2:"\ucef4\ud4e8\ud130\uacf5\ud559 \uc11d\uc0ac",projectTitle:"\ud83c\udfae \ud504\ub85c\uc81d\ud2b8",project1Title:"\ud14c\uc2a4\ud2b8 \ud504\ub85c\uc81d\ud2b8",project2Title:"Bouncing Memory",project2Subtitle:"\ucee4\uc2a4\ud140 C \uc5d4\uc9c4, 2015/09 \u2013 2016/07",project2Description:"**\uc5ed\ud560**: \ub3c4\uad6c \uac1c\ubc1c, \uac8c\uc784 \ub514\uc790\uc774\ub108\n**\ud300 \uc778\uc6d0**: 6\n\n\uac8c\uc784\uc758 \uac01 \ub808\ubca8\uc744 \uc27d\uac8c \ub9cc\ub4e4 \uc218 \uc788\ub294 \ub808\ubca8 \uc5d0\ub514\ud130\ub97c \uac1c\ubc1c\ud588\uc2b5\ub2c8\ub2e4. \uac8c\uc784 \ub514\uc790\uc774\ub108\uc600\ub358 \uc81c\uac00 \ub300\ubd80\ubd84 \uc0ac\uc6a9\ud55c \uae30\ub2a5\ub4e4\uc774\uae34 \ud558\uc9c0\ub9cc\uc694. OpenGL \uadf8\ub798\ud53d \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uc0ac\uc6a9\ud574 \ub79c\ub354\ub9c1 \ub610\ud55c \ub2f4\ub2f9\ud588\uc2b5\ub2c8\ub2e4.\n\n- 50+\uac1c \uc774\uc0c1\uc758 \ubcc0\uc218\ub97c \uc0ac\uc6a9\ud55c \uac8c\uc784 \ub0b4\uc758 \ub808\ubca8 \uc5d0\ub514\ud130\ub97c \uac1c\ubc1c\ud574, \ub808\ubca8 \uc81c\uc791 \ub09c\uc774\ub3c4\ub97c \uc644\ud654\ud558\uace0 \ub9cc\ub4dc\ub294 \uc2dc\uac04\uc744 \ud06c\uac8c \uac10\ucd95\ud558\uc600\uc2b5\ub2c8\ub2e4.\n- \ub808\ubca8 \uc5d0\ub514\ud130\ub97c \uc0ac\uc6a9\ud574 3\uac1c\uc758 \ub2e4\ub978 \ud14c\ub9c8\uc758 36\uac1c \ub808\ubca8\uc744 \ub514\uc790\uc778\ud558\uc600\uc2b5\ub2c8\ub2e4.\n- \uc5d4\uc9c4 \uad6c\uc870 \ucf54\ub4dc \uac1c\uc120\uacfc \ubb3c\ub9ac \uc5d4\uc9c4 \uad6c\uc0c1\uc744 \ub3c4\uc640 3+\uba85 \ud300\uc6d0\ub4e4\uc5d0\uac8c \ub3c4\uc6c0\uc774 \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\n\n[\ud574\ubcf4\ub7ec \uac00\uae30(Windows \uc804\uc6a9)](https://www.dropbox.com/s/2pjnjedq1ksud65/BouncingMemory_Setup_Final.exe?dl=0)"},B.nE,t.li)
B.G7=new A.b7(24,{profileName:"Johnny Park",profileNameAlter:"\ubc15\uc11d\uc900 (Sukjun Park)",profilePosition:"Gameplay Programmer",profileEmail:"pos02232@gmail.com",introductionTitle:"\ud83d\udc4b Hello! I'm a gameplay programmer working at KOG.",introductionLine1:"I like to replace my mundane daily life with game development.",introductionLine2:"My life goal is to make a game that everyone has heard once about.",interestTitle:"\u2728 Interests",interest1:"Game Development",interest2:"Graphics Programming",skillLanguageTitle:"Languages",skillEngineTitle:"Game Engines / Frameworks",skillDevelopmentToolTitle:"Development Tools",skillGraphicsAPITitle:"Graphics API",educationTitle:"\ud83c\udf93 Education",educationSchool1:"DigiPen Institute of Technology",educationDegree1:u.a,educationSchool2:"Kyungpook National University",educationDegree2:"Master of Science in Computer Science",projectTitle:"\ud83c\udfae Projects",project1Title:"Test Project",project2Title:"Bouncing Memory",project2Subtitle:"Custom C Engine, Sept.2015 \u2013 July.2016",project2Description:"**Worked as**: Tool Maker, Game Designer\n**Team members**: 6\n\nBuilt the level editor which let us design and implement levels in-game. I was also the game designer, so most of the time I used it for myself though. I was in charge of graphics pipeline (OpenGL) too.\n\n- Modeled in-game level editor with 50+ editable variables which simplified levelcreating steps and boosted level building time.\n- Designed 36 levels with 3 themed-episodes using engine\u2019s level editor.\n- Helped 3+ teammates formalize physics and engine structure, motivating team members and helping to improve their codes.\n\n[Try it here! (Windows only)](https://www.dropbox.com/s/2pjnjedq1ksud65/BouncingMemory_Setup_Final.exe?dl=0)"},B.nE,t.li)
